import React, { useState, useEffect , useCallback } from "react";
import MetaTags from "react-meta-tags";  

import BootstrapTable from "react-bootstrap-table-next";
import paginationFactory from "react-bootstrap-table2-paginator";
//Import Breadcrumb
import Breadcrumbs from "../../components/Common/Breadcrumb";
import '../../config';
import {
    Row,
    Col,
    Card,
    CardBody,
    CardTitle,
    Container,
    UncontrolledAlert,
    Button,
    Alert
  } from "reactstrap";
  
  import { getData as onGetData, getDataImage as onGetDataImage, resetDonwload } from "../../store/donwloaddata/actions"

//redux
import { useSelector, useDispatch } from "react-redux"

import './TestingPage.css'

const TestingPage = () => {
    // const [getTodos, setTodos] = useState([
    //     { id: 1, title: 'Eat'},
    //     { id: 2, title: 'Sleep'},
    //     { id: 3, title: 'Code'}
    // ])

    // console.log(getTodos)

    // const eventCreateTodo = (todo) => {
    //     setTodos(getTodos.concat(todo))
    //     console.log(getTodos)
    // }

    return (
        <React.Fragment>
          <div className="page-content">
            <MetaTags>
              <title>
              Korindo App
              </title>
            </MetaTags>
            <Container fluid={true}>
              <Breadcrumbs title="Forms" breadcrumbItem="Download foto dengan marking" />
    
              {error && error ? <Alert color="danger">{error}</Alert> : null}
             
              <Button disabled={isSending} onClick={sendRequest}
                color="primary"
                className="btn btn-primary col-sm-1"
              >
                Refresh
              </Button>
              <br/>
              <br/>
              <Row>
                  
                        
                <Col>
                  <Card>
                    <CardBody>
                      <CardTitle>List Entry Data Marking </CardTitle>
    
                      <div className="table-responsive">
                      <BootstrapTable
                        keyField = "id"
                        remote ={{ filter: true, pagination: true, sort: true, cellEdit: true }}
                        data = {entrydata.data}
                        columns = {columns}
                        pagination = {paginationFactory ({
                            page : req.page,
                            sizePerPage : req.limit,
                            sizePerPageList : [5, 10,20],
                            totalSize : entrydata.total,
                            showTotal: true,
                        })}
                        onTableChange = {handleTableChange}
                        striped
                        hover
                        condensed
                      />
                      </div>
                    </CardBody>
                  </Card>
                </Col>
              </Row>
            </Container>
          </div>
        </React.Fragment>
      );
};

export default TestingPage
